import React from "react";
import './Homestays.css';
import Header from "../../components/common/Header/Header";
import SecondBanner from "../../components/Banner/secondBanner";
import { homestays_items } from "../../assets/assets";
import Homestays_data from "../../components/data_trek_homestays/homestays_data";

const Homestays = () => {
    return (
        <>
        <Header />
        <SecondBanner />
        <section className="Homestays-section">
            <div className="all-cards">
                {homestays_items.map((item, index) => {
                    return (
                        <Homestays_data
                        key={index}
                            id={item.id}
                            name={item.name}
                            duration={item.duration}
                            difficulty={item.difficulty}
                            real_price={item.real_price}
                            discounted_price={item.discounted_price}
                            image={item.image}
                            difficulty_image={item.difficulty_image}
                            dur_image={item.dur_image}
                            />
                    );
                })}
            </div>
        </section>
        </>
    )
}

export default Homestays;
